import numpy as np
import matplotlib.pyplot as plt

# Parámetros del algoritmo genético
pop_size = 50
chromosome_length = 10
crossover_prob = 0.85
mutation_prob = 0.07
generations = 100

# Función de crecimiento
def growth_function(c):
    return (2 * c) / (4 + 0.8 * c + c**2 + 0.2 * c**3)

# Generar una población inicial de binarios
def generate_population(size, length):
    return np.random.randint(2, size=(size, length))

# Convertir binario a decimal
def binary_to_decimal(binary):
    return int("".join(str(x) for x in binary), 2)

# Escalar el valor decimal al rango [0, 10]
def scale_to_range(value, bit_length, min_val=0, max_val=10):
    return min_val + (max_val - min_val) * (value / (2**bit_length - 1))

# Evaluar la aptitud de cada cromosoma en la población
def evaluate_population(population):
    return np.array([growth_function(scale_to_range(binary_to_decimal(individual), chromosome_length)) for individual in population])

# Selección por torneo
def tournament_selection(population, fitness, tournament_size=3):
    selected_indices = np.random.choice(range(len(population)), size=tournament_size, replace=False)
    selected = population[selected_indices]
    selected_fitness = fitness[selected_indices]
    return selected[np.argmax(selected_fitness)]

# Cruza monopunto
def crossover(parent1, parent2):
    if np.random.rand() < crossover_prob:
        point = np.random.randint(1, chromosome_length - 1)
        child1 = np.concatenate((parent1[:point], parent2[point:]))
        child2 = np.concatenate((parent2[:point], parent1[point:]))
        return child1, child2
    else:
        return parent1, parent2

# Mutación
def mutate(individual):
    for i in range(chromosome_length):
        if np.random.rand() < mutation_prob:
            individual[i] = 1 - individual[i]
    return individual

# Algoritmo genético
def genetic_algorithm():
    population = generate_population(pop_size, chromosome_length)
    best_fitness_per_generation = []
    for generation in range(generations):
        fitness = evaluate_population(population)
        new_population = []
        for _ in range(pop_size // 2):
            parent1 = tournament_selection(population, fitness)
            parent2 = tournament_selection(population, fitness)
            child1, child2 = crossover(parent1, parent2)
            new_population.extend([mutate(child1), mutate(child2)])
        population = np.array(new_population)

        # Evaluar y almacenar la mejor aptitud de la generación actual
        fitness = evaluate_population(population)
        best_fitness = np.max(fitness)
        best_fitness_per_generation.append(best_fitness)

        # Mostrar el mejor resultado de la generación actual
        best_individual = population[np.argmax(fitness)]
        best_value = scale_to_range(binary_to_decimal(best_individual), chromosome_length)
        print(f"Generación {generation + 1}: Mejor aptitud = {best_fitness:.4f}, Mejor valor de c = {best_value:.2f}")

    # Devolver el mejor individuo, su valor decimal y la aptitud por generación
    best_individual = population[np.argmax(fitness)]
    best_value = scale_to_range(binary_to_decimal(best_individual), chromosome_length)
    return best_individual, best_value, best_fitness_per_generation

# Ejecutar el algoritmo genético
best_individual, best_value, best_fitness_per_generation = genetic_algorithm()
print(f"\nMejor individuo: {best_individual}, Mejor valor de c: {best_value:.2f}")

# Graficar g en función de c en el intervalo [-1, 20]
c_values = np.linspace(-1, 20, 1000)
g_values = growth_function(c_values)

plt.plot(c_values, g_values, label='g(c)')
plt.scatter([best_value], [growth_function(best_value)], color='red', label='Máximo encontrado')
plt.title('Crecimiento g en función de c')
plt.xlabel('Concentración del alimento (c)')
plt.ylabel('Tasa de crecimiento (g)')
plt.legend()
