plt.show()

# Graficar las mejores aptitudes encontradas en función de cada generación
plt.plot(range(generations), best_fitness_per_generation, label='Mejor aptitud por generación')
plt.title('Mejor aptitud por generación')
plt.xlabel('Generación')
plt.ylabel('Mejor aptitud')
plt.legend()
plt.grid(True)
plt.show()

