import numpy as np
import matplotlib.pyplot as plt

# Parámetros del algoritmo genético
pop_size = 100
chromosome_length = 10
crossover_prob = 0.85
mutation_prob = 0.07
generations = 100

# Función de concentración
def concentration_function(x, y):
    return 7.7 + 0.15*x + 0.22*y - 0.05*x**2 - 0.016*y**2 - 0.007*x*y

# Generar una población inicial de valores x e y en sus rangos respectivos
def generate_population(size, x_range, y_range):
    population = []
    for _ in range(size):
        x = np.random.uniform(*x_range)
        y = np.random.uniform(*y_range)
        population.append((x, y))
    return np.array(population)

# Evaluar la aptitud de cada individuo en la población
def evaluate_population(population):
    return np.array([concentration_function(x, y) for x, y in population])

# Selección por ruleta
def roulette_wheel_selection(population, fitness):
    total_fitness = np.sum(fitness)
    relative_fitness = fitness / total_fitness
    probabilities = np.cumsum(relative_fitness)
    rand = np.random.rand()
    for (i, individual) in enumerate(population):
        if rand <= probabilities[i]:
            return individual

# Cruza de dos puntos
def crossover(parent1, parent2):
    if np.random.rand() < crossover_prob:
        x1, y1 = parent1
        x2, y2 = parent2
        return (x1, y2), (x2, y1)
    else:
        return parent1, parent2

# Mutación
def mutate(individual, x_range, y_range):
    x, y = individual
    if np.random.rand() < mutation_prob:
        x = np.random.uniform(*x_range)
    if np.random.rand() < mutation_prob:
        y = np.random.uniform(*y_range)
    return x, y

# Algoritmo genético
def genetic_algorithm():
    x_range = (-10, 10)
    y_range = (0, 20)
    population = generate_population(pop_size, x_range, y_range)
    best_fitness_per_generation = []

    for generation in range(generations):
        fitness = evaluate_population(population)
        new_population = []
        for _ in range(pop_size // 2):
            parent1 = roulette_wheel_selection(population, fitness)
            parent2 = roulette_wheel_selection(population, fitness)
            child1, child2 = crossover(parent1, parent2)
            new_population.extend([mutate(child1, x_range, y_range), mutate(child2, x_range, y_range)])
        population = np.array(new_population)

        # Evaluar y almacenar la mejor aptitud de la generación actual
        fitness = evaluate_population(population)
        best_fitness = np.max(fitness)
        best_fitness_per_generation.append(best_fitness)

        # Mostrar el mejor resultado de la generación actual
        best_individual = population[np.argmax(fitness)]
        print(f"Generación {generation + 1}: Mejor aptitud = {best_fitness:.4f}, Mejor individuo = {best_individual}")

    # Devolver el mejor individuo, su valor decimal y la aptitud por generación
    best_individual = population[np.argmax(fitness)]
    return best_individual, best_fitness, best_fitness_per_generation

# Ejecutar el algoritmo genético
best_individual, best_fitness, best_fitness_per_generation = genetic_algorithm()
print(f"\nMejor individuo: {best_individual}, Mejor aptitud: {best_fitness:.4f}")

